//jquery FUNCTIONS
  var htmlStr='';
  var titleHover=[];
  var titleSpec=[];
  var contTile = 0;

function buildCards(dataTable,dbString,hover1,hover2,hover3,filterStr1, filterStr2, filterStr3){
    for (var i = 0; i < dataTable.length; i++) {
      buildTile(dataTable,i,dbString,hover1,hover2,hover3);
    }
    filterArraylist[contFilterArray]=[dbString,filterStr1, filterStr2, filterStr3];
    contFilterArray +=1;
}

  //reads datatables and creates the elements
  function buildTile(dataTable,i,dbString,hover1,hover2,hover3){
    var imgAmazon, price,name, priceToHtml,hoverSpecs, allSpecs;
    var rowsSpecsDiv=[];
    var rowsHoverDiv=[];
    var contSpecRow = 0;
    var contHoverRow = 0;
    var contTitleSpec = 0;
    var contTitleHover = 0;

    for (var j = 0; j < dataTable[i].length; j++) {
      if (i == 0) {
          //title row

          titleSpec[j]=  '<div class="col-md-6 col-sm-6 col-xs-6"><div class="lblType"><strong>'+ dataTable[i][j] +'</strong></div></div>';
          //contTitleSpec +=1;
          //all specs
          if (j==hover1 || j==hover2 || j==hover3) {
            //hover div
            titleHover[j]= '<div class="titleHover">'+ dataTable[i][j] +'</div>';
            //contTitleHover +=1;
          }

      }
      if(i>0 & j==1){
        name = '<div class="col-md-6 col-sm-6 col-xs-6 wrapperSpec"><div class="nameProd idbtn">'+ dataTable[i][j] +'</div></div>';
      }
      if(i>0 & j==2){
          //price row
          price ='<div class="col-md-6 col-sm-6 col-xs-6"><a class="priceProd" href="'+ dataTable[i][j] +'">show price</a></div>';
          priceToHtml = dataTable[i][j];
      }
      if(i>0 & j==3){
          //img Amazon row
          imgAmazon= '<div class="imgAmazon">'+ dataTable[i][j] +'</div>';  /*IMAGE*/
      }
      if(i>0 & j==hover1|| i>0 & j==hover2 || i>0 & j==hover3){  //4,5,6 will change to var
          //hoverDiv
          hoverSpecs= '<div class="specHover idbtn"><h6>'+ dataTable[i][j] +'</h6></div>';
      }
      if(i>0 & j!=1 & j!=3 & j!=2){
          //all specs
          allSpecs= '<div class="col-md-6 col-sm-6 col-xs-6 wrapperSpec"><div class="idbtn">'+ dataTable[i][j] +'</div></div>';
      }

      //ROWS
      //check if j isnt amazon image to generate rows with even and odd class
      if (i>0 || j!=3) {
        var evenOddClassRow ='';
        if(j%2==0){
          evenOddClassRow = 'par';
        }else{
          evenOddClassRow = 'impar';
        }
        //spec div row
        if(j==1){
          rowsSpecsDiv[contSpecRow]='<div class="row '+ evenOddClassRow +'">'+ titleSpec[j]+name +'</div>';
          contSpecRow+=1;
        }else if (j==2) {
          rowsSpecsDiv[contSpecRow]='<div class="row '+ evenOddClassRow +'">'+ titleSpec[j]+price +'</div>';
          contSpecRow+=1;
        }else{
          rowsSpecsDiv[contSpecRow]='<div class="row '+ evenOddClassRow +'">'+ titleSpec[j]+allSpecs +'</div>';
          contSpecRow +=1;
        }

      }

      //generate hover title rows
      if (i>0 & j==hover1 || i>0 & j==hover2 || i>0 & j==hover3) {
        //hover div row
        var str ='';
        if(j==hover1){str = 'hover1'}
        else if(j==hover2){str = 'hover2'}
        else if(j==hover3){str = 'hover3'}
        rowsHoverDiv[contHoverRow]='<div class="rowHover '+str+'">'+ titleHover[j]+hoverSpecs +'</div>';

        contHoverRow +=1;
      }

    }

    if (i!=0) {
     generateTile(dbString,contTile,imgAmazon,rowsSpecsDiv,rowsHoverDiv,priceToHtml);
      contTile +=1;
    }
  }

  //append long html string to gridContainer
  function generateTile(dbString,index,imgAmazon,rowsSpecsDiv,rowsHoverDiv, priceToHtml){
    //var htmlStr ='';
    var largeStringSpecs ='';
    var largeStringHover ='';
    for (var i = 0; i < rowsSpecsDiv.length; i++) {
      largeStringSpecs += rowsSpecsDiv[i];
    }
    for (var j = 0; j < rowsHoverDiv.length; j++) {
      largeStringHover += rowsHoverDiv[j];
    }
    //add little strings to htmlStr and append it to gridContainer
    htmlStr =  '<div class="col-md-3 col-sm-6 col-xs-12 rowModal '+dbString+'" id="'+dbString+ index +'">'+
                 '<div class="demo-card-square mdl-card mdl-shadow--2dp">'+
                    '<div class="card-title">'+imgAmazon+'</div>'+
                    '<div class="hoverDiv">'+
                         '<div class="specDiv">'+ largeStringHover +'</div>'+
                    '</div>'+
                    '<div class="allSpecs">'+ largeStringSpecs +'</div>'+
                  '</div>'+
                  '<div class="row btnDiv">'+
                    '<a class="col-md-6 col-sm-6 col-xs-6"><div id="btnComparecoffee'+ index +'" class="btn button-1 imgCompare">COMPARE</div></a>'+
                    '<a class="col-md-6 col-sm-6 col-xs-6" href="'+priceToHtml+'" target="_blank"><div id="btnAmazon'+ index +'" class="btn button-2 imgBuyNow">BUY NOW!</div></a>'+
                  '</div>'+
                '</div>';
    $('#gridContainer').append(htmlStr);
  }

